function couleur_G(a){	
		if (a==0){return 'rgb(0, 0, 255)';}   	    // bleu
		if (a==1){return 'rgb(0, 255, 0)';}  		// vert
		if (a==2){return 'rgb(255, 255, 0)';}      // jaune
		if (a==3){return 'rgb(50, 50, 50)';}         // gris
		if (a==4){return 'rgb(120, 20, 20)';}     // brun
		if (a==5){return 'rgb(0, 255, 255)';}     // cyan
		if (a==6){return 'rgb(255, 0, 0)';}     // rouge
		if (a==7){return 'rgb(244, 102, 27)';}     // orange
		if (a==8){return 'rgb(255, 192, 203)';}     // rose
		if (a==9){return 'rgb(128, 0, 128)';}     // violet
		if (a==10){return 'rgb(0, 100, 0)';}     // vert foncÃ©
}

	
function loadMap(map){
	for (i = 0; i < 50; i++) {    
		for (j = 0; j < 50; j++) {
			tab[i][j] = eval(map)[i][j];
		}
	}
}

function ChangeCurrentMap(n){
	currentMap = n;
}

function init(){
	clearTimeout(repet);
	
	loadMap(currentMap);

									
	dessine(tab);
	turn()
}

function turn(){
	for (i = 0; i < 50; i++) {    
		for (j = 0; j < 50; j++) {
				done[i][j] = 0;
		}    					
	}

	for (i = 0; i < 50; i++) {    
		for (j = 0; j < 50; j++) {
				if(done[i][j] == 0 && ![0,1].includes(tab[i][j]) && Math.floor(Math.random() * 10)==0 ){
					
					if(i > 0 && ![0,tab[i][j]].includes(tab[i-1][j])){
						tab[i-1][j] = tab[i][j];
						done[i-1][j] = 1;
					}
					
					if(i < 49 && ![0,tab[i][j]].includes(tab[i+1][j])){
						tab[i+1][j] = tab[i][j];
						done[i+1][j] = 1;
					}

					if(j > 0 && ![0,tab[i][j]].includes(tab[i][j-1])){
						tab[i][j-1] = tab[i][j];
						done[i][j-1] = 1;
					}
					
					if(j < 49 && ![0,tab[i][j]].includes(tab[i][j+1])){
						tab[i][j+1] = tab[i][j];
						done[i][j+1] = 1;
					}
				}
		}    					
	}
	dessine(tab);
	repet = setTimeout(turn,30);
}

	
function dessine(tab){                                        

	var canvas1 = document.getElementById("canvas");
	if (canvas1.getContext) {
		var ctx = canvas1.getContext("2d");
			for ( i = 0; i < 50; i++) {
				for ( j = 0; j < 50; j++) {
					ctx.fillStyle = couleur_G(tab[i][j]);
					ctx.fillRect(8*(j),8*(i), 8, 8);										
				}
			}
	}
}	
							


				